import '../css/maze.css'

function Maze() {
    var no_rows=new Array(10).fill(true)
    var no_columns=new Array(20).fill(true)
    var i=0
    var grids=[]
    no_rows.forEach(()=>{
        no_columns.forEach(()=>{
            grids.append("<div className='grid'>"+i+"</div>");
            i++;
        });
    });
    return (
        <div className="maze">
           {grids}
        </div>
    );
};

export default Maze;
